import React, {Component} from 'react';
import axios from 'axios'
import './Chatbox.css';

class Chatbox extends Component {
    constructor(props){
        super(props)
        this.state = {
        };
    }
    async componentDidMount() {
        var data = '{sex: "male",age: {"value": 30},evidence: [{"id": "s_1193","choice_id": "present","source": "initial"},{"id": "s_488","choice_id": "present"},{"id": "s_418","choice_id": "present"}]}';
        var options = {
            url: 'https://api.infermedica.com/v2/diagnosis',
            method: 'POST',
            headers: {
                'App-Id': 'aa2fb846',
                'App-Key': '150bc1e17a9a86a6c21f7e0f4cfa9d41',
                'Content-Type': 'application/json'
            },
            body: data
          };

          await axios.request(options).then(function (response) {
              console.log(response.data.conditions);
              console.log('hi')
          }).catch(function (error) {
              console.error(error);
          });
    }
    render() {
        return (
            <div className='Chatbox'>
                <h1 className='Chatbox-Title'>Chatbox</h1>
                <div className='Chatbox-Content'>
                </div>
            </div>
        );
    }
}

export default Chatbox;
